import "bootstrap/dist/css/bootstrap.css"
import Home from "./pages/Home";
import {BrowserRouter, Routes, Route} from "react-router-dom";

function App() {
  return (
      <BrowserRouter>
          <Routes>
              <Route index element={Home}></Route>

          </Routes>
      </BrowserRouter>
  );
}

export default App;
